import './App.css';

import React from 'react';

import { BrowserRouter } from 'react-router-dom';

import Acceuil from './component/Acceuil';
import Menu from './component/Menu';

function App() {
  return (
    <BrowserRouter>
      <Menu />
      <Acceuil />
    </BrowserRouter>
  );
}

export default App;
